class Solution(object):    def findMaxAverage(self, nums, k):        """        :type nums: List[int]        :type k: int        :rtype: float        """        n=len(nums)        if n==k:            return 1.0*sum(nums)/k        sums=[0 for i in range(n)]        sums[0]=nums[0]        for i in range(1,n):            sums[i]=sums[i-1]+nums[i]        temp=sums[k-1]        for j in range(k,n):            temp=max(temp,sums[j]-sums[j-k])        return 1.0*temp/ks = Solution()nums = [9,7,3,5,6,2,0,8,1,9]k = 6print(s.findMaxAverage(nums,k))